import React, { Component } from 'react';


class About extends Component {
    render() {
        return (
            <div className="condiv">
            <h1 className="subtopic">About Me</h1>
            <h4>Hey there,</h4>
            <h1>I'm Sadhna Singh</h1>
            <h3>Full Stack Web Developer</h3>
            <br></br>
            <p>I started my journey in the world of computers from 2013, 
            Pursued my Software Engineering Degree from University of Mumbai in 2017. 
            My life revolves around Work, Exploring new things, Drawings, Entertainments, Reading & Travelling.
            </p>

            </div>
            )
        }
    }

export default About
